  return new Promise((resolve) => {
    console.log('queryColor only once');
    setTimeout(() => {
      resolve({
        data: [
          { name: '\u7EA2', id: 1 },
          { name: '\u7EFF', id: 2 },
        ],
      });
    }, 1000);
  });
